import React from "react";
import Navbar from "../Components/Navbar";
import '../CSS/Resources.css'
import "../CSS/Aptitude.css";
function Resources() {
  return (
    <div>
      <div className="Resources_Navbar">
        <Navbar />
      </div>
      
      <div className="Resources_Body">
        <h1>Resources</h1>
      </div>
    </div>
  );
}

export default Resources;
